import React, { useState, useEffect } from "react";
import axios from "axios";
const Register =()=>{
	const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [fullname, setfullname] = useState("");
  const [address, setaddress] = useState("");
  const [phone_number, setphone_number] = useState("");
  const [isLoggedIn, setIsLoggedIn] = useState(true);

  const handleLogin = () => {
    axios
      .post(`http://localhost:8080/api/sers`, {
        email,
        password,
		fullname,
		address,
		phone_number,
      })
      .then((response) => {
        if (response.data.success) {
          setIsLoggedIn(true);
        } else {
          alert(response.data.message);
        }
      })
      .catch((error) => {
        console.error(error);
      });
  };
  useEffect(() => {
    if (isLoggedIn) {

    }
  }, [isLoggedIn]);

		return(
			<section class="section-content padding-y">
		<div class="card mx-auto" style={{ width: '520px' }} >
			<article class="card-body">
				<header class="mb-4"><h4 class="card-title">Sign up</h4></header>
				<form>
					<div class="form-row">

						<label>First name</label>
						<input
						class="form-control"
							type="fullname"
							placeholder="Fullname"
							value={fullname}
							onChange={(e) => setfullname(e.target.value)}
						/>


					</div>
					<div class="form-group">
						<label>Email</label>
						<input
						class="form-control"
							type="email"
							placeholder="Email"
							value={email}
							onChange={(e) => setEmail(e.target.value)}
						/>

					</div>

					<div class="form-row">
						<label>Password</label>
						<input
						class="form-control"
							type="password"
							placeholder="Mật khẩu"
							value={password}
							onChange={(e) => setPassword(e.target.value)}
						/>
					</div>

					<div class="form-row">
						<label>address</label>
						<input
						class="form-control"
							type="address"
							placeholder="address"
							value={address}
							onChange={(e) => setaddress(e.target.value)}
						/>
					</div>

					<div class="form-row">
						<label>Phone</label>
						<input
						class="form-control"
							type="phone_number"
							placeholder="phone_number"
							value={phone_number}
							onChange={(e) => setphone_number(e.target.value)}
						/>
					</div>:

					<div class="form-group">
						<button    onClick={handleLogin} type="submit" class="btn btn-primary btn-block"> Register  </button>
					</div>
					<div class="form-group">
						<label class="custom-control custom-checkbox"> <input type="checkbox" class="custom-control-input" checked="" /> <div class="custom-control-label"> I am agree with <a href="#">terms and contitions</a>  </div> </label>
					</div>
				</form>
			</article>
		</div>


		</section>

		);


};
export default Register
